import Navbar from './components/Navbar';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Countries from './components/Countries';

import './index.css';
function App() {
  return (
    <BrowserRouter>
      <Navbar />

      <Routes>
        <Route path='/' element={<Countries />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
